Ремонт класса бизнес и люкс осуществляется по дизайн-проекту интерьера, разрабатываемому в нашей студии. 

Выполняем высококачественную отделку. Основные особенности:
- натуральный камень;
- художественный паркет;
- авторские витражи и панно;
- венецианская штукатурка;
- дизайнерские потолочные конструкции;
- авторские стеновые панели, двери, колонны...

Стоимость 30 000 в месяц

Доведем до результата ваш объект, соединим дизайн проект с реальностью

- Регулярные выезды автора проекта на объект (до 2-х раз в неделю);
- Контроль соответствия проводимых работ дизайн – проекту;
- Необходимое общение с прорабом на объекте, в т.ч. и по телефону
(консультации по всем предоставленным чертежам);

Звоните, чтобы узнать подробности!

